	add("shaft", "{\"term\":\"shaft\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) sceaft, from Proto-germanic {{m|gem-pro|*skaftaz}}. Cognate with Dutch schacht, German Schaft, Swedish skaft.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The entire body of a long weapon, such as an arrow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His sleep, his meat, his drink, is him bereft\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027shaft\u0027\u0027 hath three principal parts, the stele, the feathers, and the head\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The long, narrow, central body of a spear, arrow, or javelin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Orion hit a rabbit once; but though sore wounded it got to the bury, and, struggling in, the arrow caught the side of the hole and was drawn out.. Ikey the blacksmith had forged us a spearhead after a sketch from a picture of a Greek warrior; and a rake-handle served as a \u0027\u0027shaft\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Anything cast or thrown as a spear or javelin\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And the thunder, / Winged with red lightning and impetuous rage, / Perhaps\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Some kinds of literary pursuitshave been attacked with all the \u0027\u0027shafts\u0027\u0027 of ridicule\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any long thin object, such as the handle of a tool, one of the poles between which an animal is harnessed to a vehicle, the driveshaft of a motorized vehicle with rear-wheel drive, an axle, etc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/4/the-adaptable-gas-turbine The Adaptable Gas passage\u003dTurbines have been around for a long time—windmills and water wheels are early examples. The name comes from the Latin \u0027turbo\u0027, meaning \u0027vortex\u0027, and thus the defining property of a turbine is that a fluid or gas turns the blades of a rotor, which is attached to a \u0027\u0027shaft\u0027\u0027 that can perform useful work\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A beam or ray of light\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, \u0027w:The Bohemian Girl (short The Bohemian Girl\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"They were a fine company of old women, and a Dutch painter would have loved to find them there together, where the sun made bright patches on the floor and sent long, quivering \u0027\u0027shafts\u0027\u0027 of gold through the dusky shade up among the rafters\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The main axis of a feather\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The long narrow body of a lacrosse stick\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A long, narrow passage sunk into the earth, either natural or for artificial\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A vertical passage housing a lift or elevator; a liftshaft\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A ventilation or heating conduit; an air duct\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Any column or pillar, particularly the body of a column between its capital and pediment\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Bid time and nature gently spare\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The main cylindrical part of the penis\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The chamber of a blast furnace\", \"priority\":22}]}, \"synonyms\":{}}");

	add("shagaholic", "{\"term\":\"shagaholic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|shag|aholic|t1\u003dto have sexual intercourse with|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is addicted to sex\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0026quot;Pianist Steve Koven and the Steve Koven Trio perform at the Downtown Jazz Festival\u0026quot;, \u0027Toronto Star\u0027, 29 June 1999\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You young \u0027uns might not believe this, but Michael Caine burst on to the screen as a bona fide sex symbol thanks to Alfie, about a Cockney \u0027\u0027shagaholic\u0027\u0027 who made the most of the Swinging \u002760s\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Alison Kerr, \u0026quot;Videos\u0026quot;, \u0027The Herald\u0027 (Glasgow), 12 December 2002\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Myers may still be having fun with his\u0027\u0027 shagaholic\u0027\u0027 spy, as well as the rest of the characters he plays, but he\u0027s the only one still laughing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, David Segal, \u0026quot;[http://articles.washingtonpost.com/2008-12-07/news/36809919_1_roger-daltrey-john-entwistle-front-row/2 The Kennedy Center Honors: Roger Daltrey \u0026amp; Pete Townshend]\u0026quot;, \u0027The Washington Post\u0027, 7 December 2008\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;I suppose in some ways I was a \u0027\u0027shagaholic\u0027\u0027,\u0026quot; [Roger Daltrey] says, chewing on a fig from a fruit platter. \u0026quot;I just liked female company on the road.\u0026quot\", \"priority\":7}]}, \"synonyms\":{}}");

