	add("shaping", "{\"term\":\"shaping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of the verb \u0027\u0027to shape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Mike Michael, \u0027Constructing Identities: The Social, the Nonhuman and Change\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In contrast to the (to be sure, productive) \u0027\u0027shapings\u0027\u0027 and constrainings of human identities in the sociotechnical network, here we have an expansion of identity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A method of positive reinforcement of behaviour patterns in operant conditioning\", \"priority\":4}]}, \"synonyms\":{}}");

