	add("shawl", "{\"term\":\"shawl\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Sanskrit\"], \"text\":\"1662. From Persian \u0027شال\u0027 from Sanskrit \u0027शाटी|tr\u003dśāṭī|lang\u003dsa\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A square or rectangular piece of cloth worn as a covering for the head, neck, and shoulders\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dThen came a maid with hand-bag and \u0027\u0027shawls\u0027\u0027, and after her a tall young lady. She stood for a moment holding her skirt above the grimy steps,, and the light of the reflector fell full upon her\", \"priority\":2}]}, \"synonyms\":{}}");

